define({"topics" : [{"title":"<span class=\"ph\">Meet StreamSets Data Collector Edge</span>","shortdesc":"\n            <p class=\"shortdesc\"><span class=\"ph\">StreamSets</span>         <span class=\"ph\">Data Collector Edge</span><sup class=\"ph sup\">TM</sup> (<span class=\"ph\">SDC Edge</span>) is a         lightweight execution agent without a UI that runs pipelines on edge devices with limited         resources.\n               Use <span class=\"ph\">SDC Edge</span> to         read data from an edge device or to receive data from another pipeline and then act on that         data to control\n               an edge device.\n            </p>\n         ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelines_Overview.html#concept_d4h_kkq_4bb","attributes": {"data-id":"concept_d4h_kkq_4bb",},"menu": {"hasChildren":true,},"tocID":"concept_d4h_kkq_4bb-d46e185502","next":"concept_d4h_kkq_4bb-d46e185502",},{"title":"Supported Platforms","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"datacollector\/UserGuide\/Edge_Mode\/SupportedPlatforms.html#concept_yxr_b5q_4bb","attributes": {"data-id":"concept_yxr_b5q_4bb",},"menu": {"hasChildren":false,},"tocID":"concept_yxr_b5q_4bb-d46e185576","topics":[]},{"title":"Install SDC Edge","shortdesc":"\n            <p class=\"shortdesc\">Download and install <span class=\"ph\">SDC Edge</span> on         each edge device where you want to run edge pipelines. \n            </p>\n         ","href":"datacollector\/UserGuide\/Edge_Mode\/SDCEInstall.html#concept_qhp_1th_pbb","attributes": {"data-id":"concept_qhp_1th_pbb",},"menu": {"hasChildren":true,},"tocID":"concept_qhp_1th_pbb-d46e185600","next":"concept_qhp_1th_pbb-d46e185600",},{"title":"Getting Started with SDC Edge","shortdesc":"\n            <p class=\"shortdesc\"><span class=\"ph\">Data Collector Edge</span> (<span class=\"ph\">SDC Edge</span>)         includes several sample pipelines that make it easy to get started. You simply import one of         the sample\n               edge pipelines, create the appropriate <span class=\"ph\">Data Collector</span>         receiving pipeline, download and install <span class=\"ph\">SDC Edge</span> on the         edge device, and then run the sample edge pipeline.\n            </p>\n         ","href":"datacollector\/UserGuide\/Edge_Mode\/GettingStartedSamples.html#concept_nd5_z4f_pbb","attributes": {"data-id":"concept_nd5_z4f_pbb",},"menu": {"hasChildren":true,},"tocID":"concept_nd5_z4f_pbb-d46e185922","next":"concept_nd5_z4f_pbb-d46e185922",},{"title":"Design Edge Pipelines","shortdesc":"\n            <p class=\"shortdesc\">Edge pipelines run in edge execution mode. You design edge pipelines in <span class=\"ph\">Data Collector</span>.\n            </p>\n         ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelineTypes.html#concept_c14_m4r_4bb","attributes": {"data-id":"concept_c14_m4r_4bb",},"menu": {"hasChildren":true,},"tocID":"concept_c14_m4r_4bb-d46e186194","next":"concept_c14_m4r_4bb-d46e186194",},{"title":"Design Data Collector Receiving Pipelines","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"datacollector\/UserGuide\/Edge_Mode\/SDCReceivingPipelines.html#concept_lqx_vtq_4bb","attributes": {"data-id":"concept_lqx_vtq_4bb",},"menu": {"hasChildren":false,},"tocID":"concept_lqx_vtq_4bb-d46e186585","topics":[]},{"title":"Administer SDC Edge","shortdesc":"\n            <p class=\"shortdesc\">Administering <span class=\"ph\">SDC Edge</span>         involves configuring, starting, shutting down, and viewing logs for the agent. When using             <span class=\"ph\">StreamSets Control Hub</span>, you can also use the <span class=\"ph\">SDC Edge</span>         command line interface to register <span class=\"ph\">SDC Edge</span> with             <span class=\"ph\">Control Hub</span>.\n            </p>\n         ","href":"datacollector\/UserGuide\/Edge_Mode\/SDCeAdminister.html#concept_ahx_zvl_pbb","attributes": {"data-id":"concept_ahx_zvl_pbb",},"menu": {"hasChildren":true,},"tocID":"concept_ahx_zvl_pbb-d46e186609","next":"concept_ahx_zvl_pbb-d46e186609",},{"title":"Deploy Pipelines to SDC Edge","shortdesc":"\n            <p class=\"shortdesc\">After designing edge pipelines in <span class=\"ph\">Data Collector</span>, you         deploy the edge pipelines to <span class=\"ph\">SDC Edge</span>         installed on an edge device. You run the edge pipelines on <span class=\"ph\">SDC Edge</span>.\n            </p>\n         ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelines_Deploy.html#concept_ldf_ycf_3db","attributes": {"data-id":"concept_ldf_ycf_3db",},"menu": {"hasChildren":true,},"tocID":"concept_ldf_ycf_3db-d46e187554","next":"concept_ldf_ycf_3db-d46e187554",},{"title":"Downloading Pipelines from SDC Edge","shortdesc":"\n            <p class=\"shortdesc\"></p>\n         ","href":"datacollector\/UserGuide\/Edge_Mode\/DownloadPipelines.html#task_vsg_wf5_32b","attributes": {"data-id":"task_vsg_wf5_32b",},"menu": {"hasChildren":false,},"tocID":"task_vsg_wf5_32b-d46e187801","topics":[]},{"title":"Manage Pipelines on SDC Edge","shortdesc":"\n            <p class=\"shortdesc\">After designing edge pipelines in <span class=\"ph\">Data Collector</span> and         then deploying the edge pipelines to <span class=\"ph\">SDC Edge</span>, you         can manage the pipelines on <span class=\"ph\">SDC Edge</span>.         Managing edge pipelines includes previewing, validating, starting, stopping, and monitoring         the pipelines\n               as well as resetting the origin for the pipelines.\n            </p>\n         ","href":"datacollector\/UserGuide\/Edge_Mode\/EdgePipelines_Manage.html#concept_tqk_dbb_4db","attributes": {"data-id":"concept_tqk_dbb_4db",},"menu": {"hasChildren":true,},"tocID":"concept_tqk_dbb_4db-d46e187825","next":"concept_tqk_dbb_4db-d46e187825",}]});